import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import '../Styles/Login.css';
import Top_Bar from "./Top-bar";

const Renew = () => {
  const [role, setRole] = useState('System Admin');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  const handleRenew = async () => {
    try {
      // Send the POST request to the Flask API
      const response = await axios.get('http://127.0.0.1:5000/renew');
      console.log('API response message:', response.data.message);
      if (response.status === 200) {
        alert(response.data.message);
        navigate('/dashboard');
      }
  } catch (error) {
        alert('Renew failed!');
        navigate('/dashboard');
  }
};


  return (
    <div className="Renew">
      <Top_Bar title="Pulling Configuration"/>
      <div className="Renew-content" >
        <div style={{display: 'flex', justifyContent: 'center', Items: 'center', textAlign: 'center'}}>
          <h1><b>Renew</b></h1>
        </div>
        <div style={{ border: '2px solid black', padding: '10px', margin: '10px 0', borderRadius: '5px',
        display: 'flex', justifyContent: 'center', Items: 'center', textAlign: 'center'}}>
          <button onClick={() => handleRenew()}>
            <h3>Renew</h3>
          </button>
        </div>
      </div>
    </div>
  );
}

export default Renew;
